import React from "react";
import "./Home.css";

class Home extends React.Component {
  constructor() {
    super();
  }

  render() {
    return (
      <div className="main">
        <div className="navbar-div"></div>
        <div className="img-div"></div>
        <div className="contents-div"></div>
        <div className="footer-div"></div>
      </div>
    );
  }
}

export default Home;
